import React,{useState} from 'react'


function Toggle({children, title}){
const [togglee, settogglee] = useState(false);
return(
<div onClick={()=> settogglee(!togglee)}>
<h4>{title}</h4>
{ togglee ? children : ''}
<hr/>
</div>
)
}

export default Toggle
